import React, { Component } from 'react';
import Prism from "prismjs"
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import '../../ReactJs/styles.css'
import Sidebar from '../sidebar';
import PrismCode from '../../ReactJs/prismCode';

import Stcksval from '../../../assets/stcks.png';

const titles = { backgroundColor: '#F0F8FF', padding: '1px', fontSize: '16px' }

const redesign = {
  height: 200,
  width: 500
}

const styles = theme => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1)
  },
  smMargin: {
    margin: theme.spacing(1)
  },
  actionDiv: {
    textAlign: "center"
  }
})


const factorial = `
var factorial = function(n){
  if(n === 1) return 1
  return n * factorial(n-1)
 }

 console.log(factorial(4));
 `.trim()

const prime = `
 function prime(){
   let i, j, result=[];
   for(i=0; i<100; i++){
     var count=0
     for(j=2; j<i; j++){
       if(i%j == 0){
         count += 1;
       }
     }
     if(count==0){
       result.push(i);
     }
   }

   console.log(result);
 }

 prime();
 `.trim()

const countPrimes = `
 const countPrimes = (n) => {
   const map = []
   for (let i = 2; i < n; i++) {
     map[i] = true
   }
   for (let i = 2; i * i < n; i++) {
     if (map[i]) {
       for (let j = i * i; j < n; j += i) {
         map[j] = false
       }
     }
   }
   return map.filter(num => num === true).length
 }

 console.log(countPrimes(10))`.trim();

const magicNumber = `
 function magicNum(){
   const random = Math.random(0,1)
   return random;
 }

 function main(){
   const result = Math.random(0, magicNum);
   console.log(result);
 }

 main();
 `.trim();

const possible = `
function isInt(value) {
  var x;
  if (isNaN(value)) {
    return false;
  }
  x = parseFloat(value);
  return (x | 0) === x;
}

console.log(isInt(0));`.trim();



const common_divisor = `
function numbers(x, y) {
    if ((typeof x !== 'number') || (typeof y !== 'number'))
      return false;
      x = Math.abs(x);
      y = Math.abs(y);
        while(y) {
          var i = y;
          y = x % y;
          x = i;
        }
  return x;
  }

  console.log(numbers(12, 4));
  console.log(numbers(9, 3));`.trim()

const addTwoNumbers = `
function ListNode(val) {
  this.val = val
  this.next = null
}

const addTwoNumbers = (l1, l2) => {
  let h1 = l1
  let h2 = l2
  let digit = 0
  let head = null
  let current = null
  while (h1 || h2) {
    const num1 = h1 ? h1.val : 0
    const num2 = h2 ? h2.val : 0
    let value = num1 + num2 + digit
    if (value >= 10) {
      value -= 10
      digit = 1
    } else {
      digit = 0
    }
    h1 = h1 ? h1.next : null
    h2 = h2 ? h2.next : null
    const node = new ListNode(value)
    if (!head) {
      head = node
      current = node
    } else {
      current.next = node
      current = node
    }
  }
  if (digit === 1) {
    current.next = new ListNode(1)
  }
  return head
}

console.log(addTwoNumbers())`.trim();

const reverse = `
const reverse = function (x) {
  let max = (2 ** 31) - 1
  let min = - (2 ** 31)

  const isMinus = x < 0
  const str = String(Math.abs(x)).split('').reverse().join('')
  const result =  isMinus ? Number('-'$'{str}') : Number(str)
  if (result > max || result < min) {
    return 0
  }
  return result
}


console.log(reverse(123))`.trim();

const longestCommonPrefix = `
const longestCommonPrefix = (strs = []) => {
  let prefix = ''
  let minLength = strs.reduce(
    (acc, str) => (acc < str.length ? acc : str.length), Infinity,
  )
  minLength = minLength === Infinity ? 0 : minLength
  for (let i = 0; i < minLength; i++) {
    const current = strs[0][i]
    const isSame = strs.every(str => str[i] === current)
    if (isSame) {
      prefix += current
    } else {
      return prefix
    }
  }
  return prefix
}`.trim();

const threeSum = `
const threeSum = function (nums) {
  nums.sort((a, b) => a - b)
  const result = []
  for (let i = 0; i < nums.length; i++) {
    if (nums[i] === nums[i - 1]) {
      continue
    }
    let left = i + 1
    let right = nums.length - 1
    while (left < right) {
      if (left > i + 1 && nums[left] === nums[left - 1]) {
        left += 1
        continue
      }
      const sum = nums[left] + nums[right] + nums[i]
      if (sum === 0) {
        result.push([nums[i], nums[left], nums[right]])
        left += 1
        right -= 1
      } else if (sum > 0) {
        right -= 1
      } else {
        left += 1
      }
    }
  }
  return result
}


console.log(threeSum([-1,0,1,2,-1,-4]))`.trim();

const threeSumClosest = `
const threeSumClosest = function (nums, target) {
  let diff = Infinity
  let result = 0
  nums.sort((a, b) => a - b)
  for (let i = 0; i < nums.length; i++) {
    let left = i + 1
